            new DataItem
        {
            Text = "AskingPrice",
            Value = askingPrice
        },
        new DataItem
        {
            Text = "PredictedPrice",
            Value = predictedPrice.Score
        }
        
            };

        m2 = predictedPrice.Score / house.SqftLiving;
        house = new Data.Texa();

    }


